import React from 'react';
import { Component } from "react";
import { Link } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


import MenuRoutes from "./MenuGlobRoutes"


interface Props {
};

interface State {
}


class MenuGlob extends Component<Props, State> {

    constructor(props: Props) {
        super(props);
    }

    render() {
        return (

            <BrowserRouter>
                <div>

                    <p>Demonstracja przykładu:</p>

                    <hr />
                    <MenuRoutes />
                    <hr />

                    <p>Wybierz interesujący Cię przykład:</p>

                    <Container fluid>                        
                        <Row><Col> <Link to='/'>Pierwsza aplikacja (wypisanie tekstu)</Link> </Col></Row>
                        <Row><Col> <Link to='/CounterApp'>Licznik (obsługa przycisków) </Link> </Col></Row>
                        <Row><Col> <Link to='/MyComponentLife'>Życie komponentu</Link>  </Col></Row>                        
                        <Row><Col> <Link to='/DemoButtons'>Demonstracja przycisków z Bootstrap</Link> </Col></Row>
                        <Row><Col> <Link to='/BootstrapDemo'>Demonstracja obszarów z Bootstrap (tzw. alertów)</Link> </Col></Row>
                        <Row><Col> <Link to='/NameForm'>Wprowadzanie tekstu jednolinijkowego</Link> </Col></Row >
                        <Row><Col> <Link to='/DNameForm'>Wprowadzanie dwóch tekstów jednolinijkowych</Link> </Col></Row >
                        <Row><Col> <Link to='/TextAreaForm'>Wprowadzanie tekstu wielolinijkowego</Link> </Col></Row>
                        <Row><Col> <Link to='/ListForm'>Wybór z listy</Link> </Col></Row>                        
                        <Row><Col> <Link to='/RadiobuttonForm'>Wybór "jeden z wielu"</Link> </Col></Row>
                        <Row><Col> <Link to='/CheckboxForm'>Wybór "kilka z wielu"</Link> </Col></Row>                                                
                        <Row><Col> <Link to='/Table1'>Tablica o stałej zawartości</Link> </Col></Row>                            
                        <Row><Col> <Link to='/Table2'>Tablica na podstawie listy rekordów </Link> </Col></Row>   
                        <Row><Col> <Link to='/TestTabs'>Menu oparte na zakładkach </Link> </Col></Row>                                                                                                                          
                        <Row><Col> <Link to='/ManyElemForm'>Kilka elementów</Link> </Col></Row >                        
                        <Row><Col> <Link to='/ManyElemFormValid'>"Ręczna" walidacja kilku elementów</Link> </Col></Row >
                        <Row><Col> <Link to='/MyFormikYup'>Walidacja kilku elementów za pomoców Formika</Link> </Col></Row >

                        <Row><Col> <Link to='/TwoWindows'>Demo okna modalnego</Link>  </Col></Row>
                        <Row><Col> <Link to='/LoginWindow'>Okienko logowania</Link> </Col></Row>                   
                                                                        
                        <Row><Col> <Link to='/DatabaseApp'>DatabaseApp</Link> </Col></Row>
                        <Row><Col> <Link to='/DataBasePerson'>DataBasePersonREST</Link> </Col></Row>                        
                        <Row><Col> <Link to='/AppStorage'>Demonstracja lokalnego magazynu</Link> </Col></Row >                                                  
                        <Row><Col> <Link to='/BankTrans'>BankTransREST</Link> </Col></Row >                                               
                                                
                        <Row><Col> <Link to='/BPersonDatabase'>BPersonDatabase</Link> </Col></Row >                       
                       
                        
                        
                        
                        
                        <Row><Col> <Link to='/TestImage'>Podgląd obrazka </Link> </Col></Row>                                                                                    
                        
                    </Container>

                    
                </div >
            </BrowserRouter >
        );

    }
}

export default MenuGlob;
